def sqrt_babylonian(S, tolerance=1e-10):
    if S < 0:
        raise ValueError("Cannot compute square root of a negative number.")
    if S == 0:
        return 0
    guess = S / 2
    while True:
        better_guess = (guess + S / guess) / 2
        if abs(better_guess - guess) < tolerance:
            return better_guess
        guess = better_guess

def lps(s):
